INSERT INTO news (nw_index, nw_title, nw_author, nw_description, nw_picture, nw_date, nw_time) VALUES (1,'Le portail nouveau est arrivé','Webmaster','&lt;br&gt;&lt;center&gt;Le portail @nao ouvre ses portes. &lt;br&gt;Découvrez ses avantages sans plus attendre.&lt;/center&gt;','investir.jpg','2003-12-08','12:00:00'),(2,'PRISME','PYLB','Après la gestion des relations Presse, ANAO s\'associe à TOSHIBA pour creer la plateforme PRISME.\r\n&lt;br&gt;&lt;br&gt;&lt;br&gt;\r\nPlateForme relationnelle des Industries de Sous-traitance Mécanique &amp; Electronique.','diffusion-controle_com.jpg','2004-01-21','02:42:28'),(3,'Le portail nouveau est arrivé','Webmaster','&lt;br&gt;&lt;center&gt;Le portail @nao ouvre ses portes. &lt;br&gt;Découvrez ses avantages sans plus attendre.&lt;/center&gt;','investir.jpg','2003-12-11','12:00:00'),(4,'Le portail nouveau est arrivé','Webmaster','&lt;br&gt;&lt;center&gt;Le portail @nao ouvre ses portes. &lt;br&gt;Découvrez ses avantages sans plus attendre.&lt;/center&gt;','investir.jpg','2003-12-12','12:00:00'),(5,'Le portail nouveau est arrivé','Webmaster','&lt;br&gt;&lt;center&gt;Le portail @nao ouvre ses portes. &lt;br&gt;Découvrez ses avantages sans plus attendre.&lt;/center&gt;','investir.jpg','2003-12-12','15:00:00'),(8,'Le portail nouveau est arrivé','Webmaster','&lt;br&gt;&lt;center&gt;Le portail @nao ouvre ses portes. &lt;br&gt;Découvrez ses avantages sans plus attendre.&lt;/center&gt;','investir.jpg','2003-12-13','16:35:00'),(11,'Le portail nouveau est arrivé','Webmaster','&lt;br&gt;&lt;center&gt;Le portail @nao ouvre ses portes. &lt;br&gt;Découvrez ses avantages sans plus attendre.&lt;/center&gt;','investir.jpg','2003-12-14','10:15:00');
